	var send=(
		window.fetch
		? function(url){
			window.fetch(url,{keepalive:true,mode:"no-cors"});
		}
		: function(url){
			new window.Image().src=url;
		}
	);

	var root=document.querySelector(".banner") || document.body	|| window;
	root.addEventListener("click",handleClick);
	if(root.onauxclick!==undefined){
		root.addEventListener("auxclick",function(e){
			if(e.button===1){
				handleClick(e);
			}
		});
	}
	else{
		(function(){
			var middle;
			root.addEventListener("mousedown",function(e){
				middle=e.button===1;
			});
			root.addEventListener("mouseup",function(e){
				if(e.button===1 && middle){
					handleClick(e);
				}
				middle=undefined;
			});
		}());
	}

	(function fixLinks(nextCheckDelay){
		Array.prototype.slice.call(
			document.querySelectorAll("a:not([href]),a[href=\"\"]")
		)
		.forEach(function(node){
			var offer=getOffer(getId(node));
			if(offer){
				node.href=offer[0];
				node.target=node.target || "_blank";
			}
		});
		window.setTimeout(fixLinks,nextCheckDelay,nextCheckDelay+1000);
	}(1000));

	function getId(node){
		var id;
		if(node){
			id=node.dataset && node.dataset.offerId;
			return (
				id===undefined
				? getId(node.parentNode)
				: id
			);
		}
	}

	function getOffer(id){
		return (
			(
				id
				&& (/^\w+$/).test(id)
				&& (
					offers["rtb_"+id+"_ugzTsVam9aRPZJHPBgGK_nOKdBPWOqwapJlvweGg8"]

					|| offers[id+"_ugzTsVam9aRPZJHPBgGK_oz6zx2qjgoot5kjxqsgfhevdhsnw5s9x"]
					|| offers[id+"_ugzTsVam9aRPZJHPBgGK"]
				)
			)
			|| offers[id]
			|| offers["rtb_default_url_ugzTsVam9aRPZJHPBgGK"]
			|| ""
		);
	}

	function handleClick(e){
		var id;
		var offer;
		if(e && !e.defaultPrevented){
			id=getId(e.target);
			if(id!==undefined){
				offer=getOffer(id);
				if(offer){
/*
*/
					if(window.open(offer[0],"_blank")){
						e.preventDefault();
						return false;
					}
				}
			}
		}
	}

	(function checkResponses(nextCheckDelay){
		window.performance.getEntries().forEach(function(entry){
			var status=entry.responseStatus;
			if(status>=400 && status<500){
				reportError(status+" "+entry.name);
			}
		});
		window.setTimeout(checkResponses,nextCheckDelay,nextCheckDelay+1000);
	}(1000));

	window.addEventListener("error",function(e){
		reportError(e && e.message);
	});

	function reportError(text){
		if(
			text
			&& errorLimit>0
			&& !errorHistory.includes(text)
		){
			errorLimit-=1;
			errorHistory.push(text);
			send(
				"https://adtracker.toolscdn.com/v1/reports/tracks/create"
				+"?IH=e6ZJw4dWBvrWRGgCfRtG"
				+"&AH=OiIKV8DdRsC6DWlZuu25"
				+"&SH=ugzTsVam9aRPZJHPBgGK"
				+"&CH=nOKdBPWOqwapJlvweGg8"
				+"&BT=REPORT"
				+"&ERR="+window.encodeURIComponent(text.slice(0,500))
				+"&T="+window.Date.now()
			);
		}
	}

	if(window.ReportingObserver){
		new window.ReportingObserver(
			function(reports){
				reports.forEach(function(report){
					var info=(
						report.body
						&& (report.body.message || report.body.reason)
					);
					reportError(
